import React from 'react';

const Header = () => {

  return (
    <>
			<header>
				<nav className="navbar navbar-dark bg-dark">
				  <div className="container">
				  	<h1 className="navbar-brand">Orion Health Online Portal</h1>
				  </div>
				</nav>
			</header>
		</>
  );
}

export default Header;
